import React, { useEffect } from "react";
import Header from "../components/Header";
import Login from "../components/Login";
import { Register } from "../components/Register";
// CSS
import "./Landing.css";

const Landing = () => {
  let [login, setLogin] = useEffect(true);

  return (
    <>
      <Header />
      <Login />
      <Register />
    </>
  );
};

export default Landing;
